window.bookSummaryJSON = "<p><i>33 Strategies of War</i> is a comprehensive guide to the subtle social game of everyday life, informed by the most ingenious and effective military principles in war. It's the <i>I-Ching</i> of conflict, the contemporary companion to Sun Tzu's <i>The Art of War</i>, and is abundantly illustrated with examples from history, including the folly and genius of everyone from Napoleon to Margaret Thatcher, Hannibal to Ulysses S. Grant, movie moguls to samurai swordsmen. </p>"; 
